import React from 'react'

const produtos = [
  { nome: 'Notebook', propriedades: ['16gb ram', '512gb'] },
  { nome: 'Smartphone', propriedades: ['2gb ram', '128gb'] },
];

const ProductTable = () => {
  return (
    produtos.map((produto) => (
      <>
        <h1>{produto.nome}</h1>
        <ul>
          <li>
            {produto.pro}
          </li>
        </ul>
      </>
    ))
  )
}

export default ProductTable
